def par_reg
	output = ''
	$parentheticals.each do |key, value|
		next if value == ''
		holder = value.gsub(/\(/, '\\(').gsub(/\)/, '\\)').sub(/^\s*/, '')
		output = "#{output}\|#{holder}"
	end
	output.sub!(/^\|\s*/, '')
	return output
end
	
