	$street_types.each do |key, value|
		export = "#{export}|#{key.to_s.sub(/\(\?(?:i-mx|-mix)\:(.*)\)/, '\1')}"
	end
	export = export.gsub(/^\s*\|/, '')
	return Regexp.new(("#{export}"), Regexp::IGNORECASE)
end
$street_types_regex = build_strtypes

def build_acro
	export = ''
	$business_acronyms_subs.each do |key, value|
		export = "#{export}|#{key.to_s.sub(/\(\?(?:i-mx|-mix)\:(.*)\)/, '\1')}"
	end
	export = export.gsub(/^\s*\|/, '')
	return Regexp.new(("#{export}"), Regexp::IGNORECASE)
end
